                <input value={pass} onChange={(e) => setPass(e.target.value)}type="password"  placeholder="**********" id="password" name="password"></input>
                <button>Login</button>
            </form>
            <button onClick={props.onFormSwitch}>Don't have an account? Register here.</button>
        </>
    )
}
